import React from "react";

const LandingPage = () => (
  <div>
    <h1>Friend for your Master's</h1>
    <p>This Web App supports 5 colleges as of now.</p>
    <p>This page will contain information about Weather, Financial Aid, Location and also about Graduate Computer Science Department of 5 Universities.</p>
    <p>The University Suggestor is also Under Construction..</p>
    <p>This page is public, accessible by everyone.</p>

  </div>
);

export default LandingPage;
